import React from 'react';

const Score = ({ scoreboard }) => {
  return (
    <div>
      <h1>Scoreboard</h1>
      {scoreboard.length === 0 ? (
        <p>No scores yet!</p>
      ) : (
        <ul>
          {scoreboard.map((scoreEntry, index) => (
            <li key={index}>
              <img src={scoreEntry.avatar} alt={scoreEntry.name} width="50" />
              <strong>{scoreEntry.name}</strong>: {scoreEntry.score}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Score;
